import * as React from 'react';
import axios from 'axios';
import { useState } from 'react';
import { FilePond } from 'react-filepond'

import "filepond/dist/filepond.min.css";
import { FilePondErrorDescription, FilePondFile } from 'filepond';
import { ParsedLine } from 'models/parsed-line';
import getFileContent from 'services/file-content-service';

const FileUpload = (): JSX.Element => {
  const [file, setFile] = useState<FilePondFile>();
  const [models, setModels] = useState<ParsedLine[]>();


  const onProcessFile = (error: FilePondErrorDescription | null, file: FilePondFile) => {
    if(error){
      console.error('An error occurred in the attachment upload. Please try again.');
      setFile(undefined);
      return;
    }
    
    setFile(file);
    getFileContent(file.filename)
      .then((res) => setModels(res.data))
      .catch((err) => {
        if (err && !axios.isCancel(err)) {
          console.warn('An error occurred while trying to load processed file content.');
        }
      });
  };

  const renderTableData = (): JSX.Element => {
    return <table>
      <th>
        <td>Employee ID #1</td>
        <td>Employee ID #2</td>
        <td>Project ID</td>
        <td>Days worked</td>
      </th>
      <tbody>
      {models?.map(model => <tr>
        <td>{model.employeeIdFirst}</td>
        <td>{model.employeeIdSecond}</td>
        <td>{model.dateFirst}</td>
        <td>{model.dateSecond}</td>
      </tr>
      )}
      </tbody>
    </table>
  };

    return (
      <div>
        <FilePond
          onprocessfile={onProcessFile}
         server={{url: 'http://localhost:8080/api/attachments', process: '/upload', revert: null, restore: null, load: null, fetch: null }}
         name="file"
         labelIdle='Drag & Drop your files or <span class="filepond--label-action">Browse</span>' 
        >
        </FilePond>
        {file && <p>{file.filename}</p>}
        {file && renderTableData()}
      </div>
      
    );
}

export default FileUpload;
